CREATE DEFINER=`root`@`localhost` PROCEDURE `cD`()
begin
	declare oid1 bigint;
	declare oid2 bigint;
	
	start transaction;

	create table if not exists object (
		id bigint not null auto_increment,
		n char(255),
		c bigint,
		d timestamp,
		primary key(id),
		index(n),
		index(c),
		index(d)
	);

	create table if not exists link (
		id bigint not null auto_increment,
		o1 bigint,
		o2 bigint,
		c bigint,
		d timestamp,
		primary key(id),
		index(o1),
		index(o2),
		index(c),
		index(d)

	);

	insert into object (n) select 'Система';

	insert into object (n) select 'Время';
	set oid1 = (select LAST_INSERT_ID());
	insert into object (n) select CURRENT_TIMESTAMP();
	set oid2 = (select LAST_INSERT_ID());
	insert into link (o1, o2, c) values (oid1, oid2, 1);

