	insert into link (o1, o2, c) values (oid1, (select LAST_INSERT_ID()), 1);
	insert into object (n) select 'Правило Условие Сравнение';
	insert into link (o1, o2, c) values (oid1, (select LAST_INSERT_ID()), 1);
