CREATE DEFINER=`root`@`localhost` PROCEDURE `chRs`(condId bigint)
begin
	declare done int default false;
	declare rule bigint default 0;
	declare cur1 cursor for 
		select o1 from ( 
			select o1 from link where o2 in (gO('правило'), condId)
			union all 
			select o2 from link where o1 in (gO('правило'), condId)
		)o 
		group by o1 
		having count(*) = 2
			and o1 not in (select o1 from link where o2 = (select id from object where n = 'класс'))
		order by o1;

	declare continue HANDLER for not found set done = true;

	if gL(condId, gO('правило условие')) is not null then
		open cur1;
		read_loop: loop
			fetch cur1 into rule;

			if done then
				LEAVE read_loop;
			end if;

			call chR(rule);

		end loop;
		close cur1;
	end if;
end ;;
